import React from 'react'
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';
import './Tabs.css'
 
export default function TabComponent() {
    return (
      <div className="Tabs">
        <Tabs>
    <TabList>
      <Tab>Title 1</Tab>
      <Tab>Title 2</Tab>
    </TabList>
 
    <TabPanel>
      <h2>Any content 2</h2>
    </TabPanel>
  </Tabs>
  </div>
    )
}
